import React, { useState, Component } from 'react';
import './App.css';
import { Layout, Avatar, Menu, Icon, Breadcrumb, Button } from 'antd';
import {Link, Route, withRouter, BrowserRouter,  Switch} from "react-router-dom"
import Home from "../pages/home/Home"
import { 
  MenuFoldOutline,
  MenuUnfoldOutline
 }  from '@ant-design/icons'
import Customer from "../pages/customer/Customer"
const { Header, Footer, Sider, Content } = Layout;

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      collapsed:"true"
    };
  }

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };
  render(){
  return (
    <div className="App">

      <Layout>

        <Layout>
          <Sider trigger={null} collapsible collapsed={this.state.collapsed}>
            <Menu

              mode="inline"
              theme = "dark"

            >
              <Menu.Item key='/' >
                <Link to = "/">
                  <Icon type = "user"/>
                  <span>Home </span>
                </Link>

              </Menu.Item>
              <Menu.Item key='/customer' >
              <Link to = "/customer">
                  <Icon type = "user"/>
                  <span>Customer </span>
                </Link>
              </Menu.Item>

            </Menu>
          </Sider>
          <Layout>
          <Header style={{ backgroundColor: "white" }}>
          {/* {React.createElement(this.state.collapsed ? MenuUnfoldOutline: MenuFoldOutline, {
              className: 'trigger',
              onClick: this.toggle,
            })} */}
          </Header>
            <Content style={{ padding: '0 50px', minHeight:400, backgroundColor: "white" }}>
            <Switch>
                <Route exact path = "/"  component = {Home}/>
                <Route path = "/customer" component = {Customer}/>
              </Switch>

            </Content>
            <Footer style={{ textAlign: 'center' }}></Footer>
          </Layout>
        </Layout>
      </Layout>

    </div>
  );
  }
}

export default  App;
